import React, { Component } from "react";

class Game extends Component {
  constructor(props) {
    super(props);
    this.state = {
      id: props.id,
      name: props.name,
      availableIn: props.availableIn,
      status: props.status,
      noAvailable: props.noAvailable
    };
  }
  render() {
    return (
      <table className="table table-striped" style={{ marginTop: 20 }}>
        <thead>
          <tr>
            <th>Description</th>
            <th>Responsible</th>
            <th>Priority</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {this.state.todos.map(todo => (
            <tr>
              <td>{todo.todo_description}</td>
              <td>{todo.todo_responsible}</td>
              <td>{todo.todo_priority}</td>
              <td>
                <Link to={"/edit/" + todo._id}>Edit</Link>
                <input
                  id={todo._id}
                  type="checkbox"
                  style={{ margin: "10%" }}
                  onChange={this.handleChange}
                />
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  }
}

export default Game;
